async function getInstagramPictures(e){if(baseUrl="https://www.instagram.com",profileUrl=`${baseUrl}/${e}`,jsonDataUrl=`${profileUrl}/?__a=1`,response=await fetch(jsonDataUrl),jsonData=await response.json(),pictures=jsonData.graphql.user.edge_owner_to_timeline_media.edges,response.ok)return JSON.stringify(pictures);throw new Error(pictures)}